# Why utf8mb4_0900_ai_ci ? https://www.monolune.com/what-is-the-utf8mb4_0900_ai_ci-collation/
DROP DATABASE IF EXISTS `shootingclub`;
CREATE DATABASE IF NOT EXISTS `shootingclub` CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci;
USE shootingclub;

# https://dev.mysql.com/doc/employee/en/
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
    `user`        INT NOT NULL AUTO_INCREMENT,
    `birth_date`  DATETIME            NULL,
    `first_name`  VARCHAR(25)     NOT NULL,
    `last_name`   VARCHAR(25)     NOT NULL,
    `username`    VARCHAR(16)     NOT NULL,
    `email`       VARCHAR(255)    NOT NULL,
    `gender`      ENUM ('M','F')  NOT NULL,
    PRIMARY KEY (`user`),
    UNIQUE INDEX `user_UNIQUE` (`user` ASC)
);

